    "script_description": "This script uses Picard to calculate insert size metrics for DNA sequencing data. It iterates through folders, each representing a sample, and performs the following tasks:\n\n1.  **Loads Modules:** Loads necessary modules for Picard and R. \n2.  **Collects Insert Size Metrics:**  Runs the `CollectInsertSizeMetrics` tool from Picard to analyze alignment data (`.sam` file) and generate metrics and histograms. \n3.  **Output Files:** Creates output files with metrics (`.txt`) and a histogram of insert sizes (`.pdf`).\n\nThe script also uses the following options:\n\n*  `-I`: Specifies the input alignment file. \n*  `-O`: Specifies the output file for metrics. \n*  `-H`: Specifies the output file for the histogram. \n*  `-M`: Sets the minimum percentage of total reads a data category must have to be included in the histogram (0.5 represents 50%)."
